  true,\n\t\"url\": null,\n\t\"notes\": \"This SBIR Phase II effort will continue
  to develop and demonstrate an innovative shape memory alloy (SMA) periodic cellular
  structural technology.  Periodic cellular structures (PCS) will be designed and
  tailored to determine if additional shape memory performance benefits can be derived
  from the underlying macro-structure when fabricated from SMA's.  These structures
  will be manufactured using an advanced reactive metal casting technology that will
  allow complex-shaped, integral bulk structures to be fabricated with the requisite
  composition-microstructure-properties needed for shape memory performance.  Casting
  also offers a relatively low-cost approach for fabricating near net-shape components.
  \ The fabricated SMA structures will be characterized for resulting microstructure-properties
  in order to determine how to best design such PCS to better exploit SMA's for use
  in aerospace applications. \",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
